export const neanexOptions = [
  { value: "Object", label: "Object" },
  { value: "Space", label: "Space" },
  { value: "Location", label: "Location" },
];

export const semOptions = [
  { value: "Physical space", label: "Physical space" },
  { value: "functional space", label: "functional space" },
];
